import React, { useState, useEffect } from 'react';
import { Line } from "react-chartjs-2";


const AnalysisPage = ({history}) => {

  const data01 = {
    labels: ["Jan", "Feb", "Mar", "Apr", "May", "Jun"],
    datasets: [
      {
        label: "First dataset",
        data: [33, 53, 85, 41, 44, 65],
        fill: false,
        backgroundColor: "rgba(75,192,192,0.2)",
        borderColor: "rgba(75,192,192,1)"
      },
      {
        label: "Second dataset",
        data: [33, 25, 35, 51, 54, 76],
        fill: false,
        borderColor: "#742774"
      }
    ]
  };


  let [homeTeam, setHomeTeam] = useState("")
  let [awayTeam, setAwayTeam] = useState("")

  useEffect(() => {
    getData()
    analysisResult()  
    }, [])

    let getData = () => {
      homeTeam = localStorage.getItem('homeTeam', homeTeam)
      awayTeam = localStorage.getItem('awayTeam', awayTeam)
      setHomeTeam(homeTeam)
      setAwayTeam(awayTeam)
  }

  let analysisResult = async () => {
    fetch('http://127.0.0.1:8000/api/analysis/', {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({
            "home_team": localStorage.getItem('homeTeam'),
            "away_team": localStorage.getItem('awaTeam')
        })
    }).then(function(response) {
      return response.json();
     })
     .then(function(data) {
      console.log('Result:', data)
     })
}


  return <div>
      <h1 className='analysis'>Analysis</h1>
      <div className="App">
      <Line data={data01} />
    </div>
  </div>;
};

export default AnalysisPage;
